import React from "react";
import Sidenav from "./Sidenav";
import Button from "@material-ui/core/Button";
import "./Person.css";
const url = "http://localhost:8000/api/persons";

const style = {
    backgroundColor: "#ADD8E6"
  };
export default function PersonPage() {
    var page = 0;
    var no_per_page = 10;
    function showAll() {
        fetch(url + "/get/" + page + "/" + no_per_page,{
            method: "GET",
            headers: {
                Accept: "application/json",
                Authorization: "Bearer " + localStorage.getItem("token"),
            }
        })
        .then((res) => res.json())
        .then((data) => {
            console.log(data);
        });
    }
    return (
        <div className="PersonsPage">
            <Sidenav/>
            <main>
                <Button variant="contained" style={style}>Add new person</Button>
                <Button variant="contained" onClick={showAll}>Show all</Button>
            </main>
        </div>
    );
}
